import React from 'react'
import Head from 'next/head'

import Header from '../components/header'
import SubTitle from '../components/sub-title'
import ItemSort from '../components/item-sort'
import Footer from '../components/footer'
import Main from "../components/main"

const Admin = () => {
  return (
    <>
      <div className="container">
        <Head>
          <title>Kevin Utoft</title>
          <meta property="og:title" content="Kevin Utoft" />
        </Head>
        <Header></Header>
        <Main>
          <SubTitle title="Things"></SubTitle>
          <div className="form-group">
            <ItemSort heading="WinField United"></ItemSort>
            <ItemSort
              src="https://images.unsplash.com/photo-1447933601403-0c6688de566e?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
              heading="Roast Coffee"
            ></ItemSort>
            <ItemSort
              src="https://images.unsplash.com/photo-1573849420475-4f1c7bf06fa7?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
              heading="Fireplace Built In"
            ></ItemSort>
            <div className="cta-wrapper">
              <button className="thqButton button">Add Thing</button>
            </div>
          </div>
          <SubTitle title="Categories"></SubTitle>
          <div className="form-group">
            <ItemSort heading="Develop Code"></ItemSort>
            <ItemSort
              src="https://images.unsplash.com/photo-1447933601403-0c6688de566e?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
              heading="Enable Experiences"
            ></ItemSort>
            <ItemSort
              src="https://images.unsplash.com/photo-1573849420475-4f1c7bf06fa7?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
              heading="Build Brands"
            ></ItemSort>
            <ItemSort
              src="https://images.unsplash.com/photo-1573849420475-4f1c7bf06fa7?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
              heading="Design Products"
            ></ItemSort>
            <ItemSort
              src="https://images.unsplash.com/photo-1573849420475-4f1c7bf06fa7?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
              heading="Create Art"
            ></ItemSort>
            <ItemSort
              src="https://images.unsplash.com/photo-1573849420475-4f1c7bf06fa7?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
              heading="Cook Food"
            ></ItemSort>
            <ItemSort
              src="https://images.unsplash.com/photo-1573849420475-4f1c7bf06fa7?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
              heading="Write Articles"
            ></ItemSort>
            <ItemSort
              src="https://images.unsplash.com/photo-1573849420475-4f1c7bf06fa7?ixlib=rb-1.2.1&amp;q=85&amp;fm=jpg&amp;crop=entropy&amp;cs=srgb&amp;ixid=eyJhcHBfaWQiOjkxMzIxfQ&amp;h=1200"
              heading="Make Music"
            ></ItemSort>
            <div className="cta-wrapper">
              <button className="thqButton button1">Add Category</button>
            </div>
          </div>
          <SubTitle title="Quote"></SubTitle>
          <div className="form-group">
            <input type="text" placeholder="Home Page Quote" className="thqTextInput textinput" />
          </div>
          <SubTitle title="Description"></SubTitle>
          <div className="form-group">
            <textarea
              placeholder="About Page Description"
              className="thqTextArea textarea"
            ></textarea>
          </div>
        </Main>
        <Footer></Footer>
      </div>
      <style jsx>
        {`
          .container {
            width: 100%;
            display: flex;
            overflow: auto;
            min-height: 100vh;
            align-items: center;
            flex-direction: column;
            justify-content: flex-start;
          }
          .form-group {
            width: 100%;
            display: flex;
            padding: 20px;
            flex-wrap: nowrap;
            max-width: 800px;
            align-items: center;
            flex-direction: column;
            justify-content: flex-start;
          }
          .cta-wrapper {
            width: 100%;
            display: flex;
            flex-wrap: wrap;
            align-items: center;
            flex-direction: row;
            justify-content: flex-start;
          }
          .button {
            color: #ffffff;
            width: 100%;
            display: block;
            padding: 10px;
            align-self: center;
            margin-top: 10px;
            text-align: center;
            border-color: transparent;
            border-width: 0;
            background-color: #130930;
          }
          .container4 {
            width: 100%;
            display: flex;
            padding: 20px;
            flex-wrap: wrap;
            max-width: 800px;
            align-items: center;
            flex-direction: row;
            justify-content: flex-start;
          }
          .container5 {
            width: 100%;
            display: flex;
            flex-wrap: wrap;
            align-items: center;
            flex-direction: row;
            justify-content: flex-start;
          }
          .button1 {
            color: #ffffff;
            width: 100%;
            display: block;
            padding: 10px;
            align-self: center;
            margin-top: 10px;
            text-align: center;
            border-color: transparent;
            border-width: 0;
            background-color: #130930;
          }
          .container6 {
            width: 100%;
            display: flex;
            padding: 20px;
            flex-wrap: wrap;
            max-width: 800px;
            align-items: center;
            flex-direction: row;
            justify-content: flex-start;
          }
          .textinput {
            width: 100%;
            display: block;
            padding: 20px;
            border-color: #dbdbdb;
            border-width: 1px;
          }
          .container7 {
            width: 100%;
            display: flex;
            padding: 20px;
            flex-wrap: wrap;
            max-width: 800px;
            align-items: center;
            flex-direction: row;
            justify-content: flex-start;
          }
          .textarea {
            width: 100%;
            height: 200px;
            display: block;
            padding: 20px;
            border-color: #dbdbdb;
            border-width: 1px;
          }
        `}
      </style>
    </>
  )
}

export default Admin
